        balance += op
        if balance < 0:
            return True
    return False

def intersperse(numbers: List[int], delimeter: int) -> List[int]:
    """ Insert a number 'delimeter' between every two consecutive elements of input list `numbers'"""
    result = []
    for i, num in enumerate(numbers):
        result.append(num)
        if i != len(numbers) - 1:
            result.append(delimeter)
    return result

def string_xor(a: str, b: str) -> str:
    """ Input are two strings a and b consisting only of 1s and 0s.
    Perform binary XOR on these inputs and return result also as a string.
    >>> string_xor('010', '110')
    '100'
    """
    result = []
    for x, y in zip(a, b):
        if x != y:
            result.append('1')
        else:
            result.append('0')
    return ''.join(result)

def parse_music(music_string: str) -> List[int]:
    """ Parses a string of musical notes in ASCII format and returns a list of integers representing the number of beats each note lasts.
    The input string is split by spaces, and each note is converted based on its symbol:
    'o' - whole note (4 beats), 'o|' - half note (2 beats), '.|' - quarter note (1 beat).
    """
    notes = music_string.split()
    beats = []
    for note in notes:
        if note == 'o':
            beats.append(4)
        elif note == 'o|':
            beats.append(2)
        elif note == '.|':
            beats.append(1)
    return beats

def largest_divisor(n: int) -> int:
    """ For a given number n, find the largest number that divides n evenly, smaller than n
    >>> largest_divisor(15)
    5
    """
    for i in range(n-1, 0, -1):
        if n % i == 0:
            return i

