def is_multiply_prime(a):
    """Write a function that returns true if the given number is the multiplication of 3 prime numbers
    and false otherwise.
    Knowing that (a) is less then 100. 
    Example:
    is_multiply_prime(30) == True
    30 = 2 * 3 * 5
    """
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5)+1):
            if n % i == 0:
                return False
        return True

    primes = [i for i in range(2, a) if is_prime(i)]
    for i in primes:
        for j in primes:
            if i * j > a:
                break
            for k in primes:
                if i * j * k == a:
                    return True
    return False

def is_simple_power(x, n):
    """Returns True if x is a simple power of n, i.e., there exists an integer k such that n**k == x."""
    if n == 1:
        return x == 1
    k = 0
    current = 1
    while current < x:
        current *= n
        k += 1
    return current == x

def hex_key(num):
    """Counts the number of prime hexadecimal digits in the input string."""
    primes = {'2', '3', '5', '7', 'B', 'D'}
    return sum(1 for digit in num if digit in primes)
